import React from "react";
import styled from 'styled-components';
import logo from '../img/logo.png'
const Styles = styled.div`

@import url('https://fonts.googleapis.com/css?family=Roboto:700');

nav{
    background-color: #fff;
    position: fixed;
    top:0;
    left: 0;
    width: 100%;
    height: 90px;
    padding: 10px 100px;
    box-sizing: border-box;
    border-bottom-style: solid;
    border-bottom-width: 0.8px;
    border-bottom-color: rgb(180, 180, 180);
    transition: .5s;
  }
  
  nav.black{
    background: rgba(255, 255, 255, 1);
    height: 70px;
    padding: 10px 50px;
    border-bottom-style: solid;
    border-bottom-width: 0.5px;
    border-bottom-color: rgb(180, 180, 180);
    transition: .5s;
  }
  
  nav .logo{
    float: left;
    padding-left: 13%;
  }
  
  nav .logo img{
    height: 70px;
    transition: .5s;
  }
  
  nav.black .logo img{
    height: 50px;
    padding-left: 45%;
  }
  
  nav .home h1{
    float: left;
    
    margin-top: 1%;
    font-size:40px !important;
    font-style: oblique;
    font-weight: 500 !important;
    transition: 0.5s;
  }
  
  nav.black .home h1{
    font-size: 30px !important;
    padding-left: 25px;
    margin-top: 0.6%;
    transition: 0.5s;
  }
  
  nav ul-1{
    float: left;
    margin: 0;
    padding-left: 10%;
    display: flex;
    transition: .5s
  }
  
  
  nav ul-1 li{
    list-style-type: none;
  }
  
  
  nav ul-1 li a{
    line-height: 80px;
    color: #262626;
    padding: 5px 20px;
    font-family: 'Roboto', sans-serif;
    text-decoration: none;
    text-transform: uppercase;
    transition: .5s;
  }
  
  nav.black ul-1{
    padding-left: 12%;
  
  }
  
  nav.black ul-1 li a{
    color: #262626;
    line-height: 50px;
  }
  
  nav ul-1 li a.active, nav ul-1 li a:hover{
    color: #262626;
    text-decoration: none;
  }
  
  nav ul-2{
    float: left;
    padding-left: 14%;
    margin: 0;
    display: flex;
  }
  
  nav ul-2 li{
    list-style-type: none;
  }
  
  nav ul-2 li a{
    line-height: 80px;
    color: #262626;
    padding: 5px 20px;
    font-family: 'Roboto', sans-serif;
    text-decoration: none;
    text-transform: uppercase;
    transition: .5s;
  }
  
  nav.black ul-2 li a{
    color: #262626;
    line-height: 50px;
  }
  
  nav ul-2 li a.active, nav ul-2 li a:hover{
    color: #262626;
    text-decoration: none;
  }
` ;

export default function Navbar(){
    return (
        <Styles>
             <nav>
                <ul-1>
                <li><a href = "/" class = "active" > Home </a></li>
                <li><a href = "/product"> Products</a></li>

                </ul-1>
                <div class = "logo">
                <img src = { logo }/>
                </div>
                <div class = "home">
                <h1>Biogloura</h1>
                </div>
                <ul-2>
                <li><a href = "/" class = "active" > Home </a></li>
                <li><a href = "/product"> Products</a></li>

                </ul-2>
            </nav>
        </Styles>
          
    )
}
